2	999999999999	sistema	¡Hola! Estoy aquí para proporcionarte información sobre el vih y ayudar a tu paciente.\n\nEl vih (virus de la inmunodeficiencia humana) es un retrovirus que ataca al sistema inmunitario, específicamente a los linfocitos CD4, que son esenciales para combatir infecciones. Este virus se transmite principalmente a través de fluidos corporales, como sangre, semen, secreciones vaginales y leche materna.\n\nExisten dos tipos principales de vih: vih-1 y vih-2. El vih-1 es el más común y virulento, mientras que el vih-2 es menos prevalente y generalmente progresa más lentamente.\n\nEs importante destacar que el vih es una infección crónica que, si no se trata, puede evolucionar al síndrome de inmunodeficiencia adquirida (sida), una etapa avanzada de la enfermedad en la que el sistema inmunitario está gravemente dañado. Sin embargo, con el tratamiento adecuado, las personas con vih pueden vivir una vida larga y saludable.\n\nSi tu paciente desea más detalles sobre la biología del virus o los mecanismos de transmisión, no dudes en preguntar. Estoy aquí para proporcionar la información que necesiten.\n\nReferencias:\n- [FELGTBI+: VIH/SIDA](https://www.felgtbi.org/salud/vihsida/)\n- [OMS: VIH/SIDA](https://www.who.int/es/news-room/fact-sheets/detail/hiv-aids)	\N	\N	2024-12-10 11:19:22.058138	\N
