lquier duda que puedan tener.\n\nRecuerda que es importante buscar apoyo si te sientes ansioso o necesitas ayuda adicional. La FELGTBI+ también ofrece [servicios de atención psicológica](https://www.felgtbi.org/servicios-de-atencion-psicologica/) y [grupos de apoyo](https://www.felgtbi.org/grupos-de-apoyo/) que pueden ser de gran ayuda en estos momentos.\n\nTomar la decisión de compartir tu diagnóstico es un paso valiente y significativo. ¡Mucha fuerza y ánimo en este proceso!\n\n**Referencias:**\n- FELGTBI+. (s.f.). [Página web oficial](https://www.felgtbi.org/).\n- FELGTBI+. (s.f.). [Información sobre vih](https://www.felgtbi.org/vih-sida/).\n- FELGTBI+. (s.f.). [Servicios de atención psicológica](https://www.felgtbi.org/servicios-de-atencion-psicologica/).\n- FELGTBI+. (s.f.). [Grupos de apoyo](https://www.felgtbi.org/grupos-de-apoyo/).	\N	\N	2024-12-10 11:19:22.058138	\N
