30	127.0.0.1	sistema	¡Hola! Entiendo que estás buscando apoyo para afrontar una situación difícil. Decirles a tus padres que tienes el VIH puede ser una conversación complicada, pero es importante que recibas el apoyo de tu familia. Aquí te doy algunos consejos que pueden ayudarte:\n\n**Elige el momento adecuado:** Busca un momento en el que puedas hablar con ellos tranquilamente y sin interrupciones. Asegúrate de que estén relajados y abiertos a la conversación.\n\n**Prepara lo que quieres decir:** Antes de hablar con ellos, organiza tus pensamientos y decide qué información quieres compartir. Puedes escribir una lista de los puntos que deseas abordar, incluyendo cómo te sientes, los hechos sobre el VIH y tu tratamiento, y cómo les gustaría que te apoyaran.\n\n**Proporciona información precisa:** Es importante educar a tus padres sobre el VIH para disipar cualquier idea equivocada o estigma que puedan tener. Explícales lo que significa tener el VIH en la actualidad, cómo estás gestionando tu salud con el tratamiento, y enfatiza que el VIH no define quién eres. Puedes utilizar recursos confiables como la página de [información sobre el VIH de la Federación Estatal de Lesbianas, Gais, Trans, Bisexuales, Intersexuales y más (FELGTBI+)](https://felgtbi.org/vih-sida/) para obtener datos y estadísticas que puedas compartir con ellos.\n\n**Sé honesto/a sobre tus sentimientos:** Comparte con tus padres cómo te has sentido desde que recibiste el diagnóstico. Expresa tus miedos, preocupaciones y también tus esperanzas. Déjales saber que su amor y apoyo son importantes para ti.\n\n**Prepárate para sus reacciones:** Recuerda que tus padres pueden tener diferentes reacciones, y algunas de ellas pueden ser inesperadas. Pueden sentir shock, tristeza, enojo o incluso negación. Sé paciente y dales tiempo para procesar la noticia. Asegúrales que estás bien y que estás recibiendo la atención médica necesaria.\n\n**Ofrece recursos adicionales:** Proporciona a tus padres recursos confiables donde puedan obtener más información sobre el VIH, como organizaciones locales de apoyo, líneas de ayuda o sitios web educativos. Esto les ayudará a comprender mejor tu situación y a hacer preguntas si lo necesitan.\n\nRecuerda que eres valiente por enfrentar esta situación y buscar apoyo. La comunicación abierta y honesta con tus seres queridos es un paso importante para mantener tu bienestar emocional y físico. Si necesitas más recursos o apoyo adicional, no dudes en preguntar. ¡Estoy aquí para ayudarte!\n\n**Referencias:**\n- FELGTBI+. (n.d.). VIH/SIDA. https://felgtbi.org/vih-sida/\n- Ministerio de Sanidad, Servicios Sociales e Igualdad. (2017). Guía de prevención y control de la infección por el virus de la inmunodeficiencia humana (VIH). https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/alertasActual/docs/Guia_Prevencion_Control_VIH.pdf	\N	\N	2024-12-10 12:33:59.075495	llm_mvp
