96	80.102.39.52	sistema	¡Hola! Es genial que estés buscando información y recursos relacionados con el vih. Aquí hay algunos datos y recursos que pueden ser útiles para ti:\n\n**Información sobre el vih:**\n- El vih (virus de inmunodeficiencia humana) es un virus que afecta al sistema inmunológico y, si no se trata, puede causar el síndrome de inmunodeficiencia adquirida (sida).\n- La transmisión del vih ocurre principalmente a través de relaciones sexuales sin protección, transfusiones de sangre contaminada, o de madre a hijo durante el embarazo, parto o lactancia.\n- Es importante recordar que el vih no discrimina y puede afectar a personas de cualquier género, orientación sexual o identidad de género.\n\n**Recursos de divulgación y prevención:**\n- La Federación Estatal de Lesbianas, Gais, Trans, Bisexuales, Intersexuales y más (FELGTBI+) ofrece diversos recursos y campañas de prevención y concienciación sobre el vih. Puedes encontrar información en su página web [https://www.felgtbi.org/](https://www.felgtbi.org/) en la sección de salud.\n- La organización también promueve el uso del preservativo como una herramienta efectiva para prevenir la transmisión del vih y otras infecciones de transmisión sexual (ITS).\n\n**Apoyo emocional y grupos de apoyo:**\n- Es comprensible que vivir con el vih pueda generar preocupaciones y necesidades emocionales específicas. FELGTBI+ cuenta con grupos de apoyo y espacios seguros donde puedes compartir experiencias y recibir apoyo de otras personas en situaciones similares.\n- Estos grupos pueden ayudarte a lidiar con cualquier estigma o discriminación que puedas enfrentar y a fortalecer tu bienestar emocional.\n\nRecuerda que la detección temprana y el tratamiento adecuado del vih son fundamentales para mantener una buena calidad de vida. Si necesitas más información o recursos específicos, no dudes en preguntar.\n\n**Referencias:**\n- FELGTBI+. (s.f.). Salud. Recuperado de [https://www.felgtbi.org/salud/](https://www.felgtbi.org/salud/)\n- Ministerio de Sanidad, Servicios Sociales e Igualdad. (2017). Guía de prevención de infecciones de transmisión sexual. Recuperado de [https://www.mscbs.gob.es/profesionales/saludPublica/prevPromocion/saludSexual/docs/Guia_ITS.pdf](https://www.mscbs.gob.es/profesionales/saludPublica/prevPromocion/saludSexual/docs/Guia_ITS.pdf)	\N	\N	2024-12-10 13:27:22.777131	llm_mvp
