114	80.102.39.52	sistema	¡Hola! Es un placer ayudarte con cualquier consulta relacionada con el vih. Entiendo que estás buscando información y recursos, así que aquí te proporciono algunos datos útiles:\n\n**Información sobre el vih:**\n- El vih (virus de la inmunodeficiencia humana) es un virus que afecta al sistema inmunitario y, si no se trata, puede causar el síndrome de inmunodeficiencia adquirida (sida).\n- La transmisión del vih ocurre a través de fluidos corporales infectados, como sangre, semen, secreciones vaginales y leche materna.\n- Es importante recordar que el vih no se transmite a través de la saliva, el sudor o el contacto casual.\n\n**Recursos de divulgación y apoyo:**\n- La Federación Estatal de Lesbianas, Gais, Trans, Bisexuales, Intersexuales y más (FELGTBI+) ofrece una guía completa sobre el vih y el sida, que puedes encontrar en su página web: [Guía FELGTBI+ sobre VIH/SIDA](https://www.felgtbi.org/publicaciones/guia-vih-sida-2019/).\n- En esta guía encontrarás información detallada sobre la prevención, la prueba del vih, el tratamiento y los derechos de las personas con vih.\n- Además, FELGTBI+ cuenta con un servicio de atención telefónica y por correo electrónico para brindar apoyo y asesoramiento: [Contacto FELGTBI+](https://www.felgtbi.org/contacto/).\n\n**Apoyo emocional:**\n- Si necesitas apoyo emocional o hablar con alguien sobre tu situación, existen organizaciones y líneas de ayuda especializadas:\n   - Apoyo Positivo: Ofrecen atención psicológica y emocional para personas con vih. Puedes contactarles a través de su página web o por teléfono: [Apoyo Positivo](https://apoyopositivo.org/).\n   - Línea de Ayuda sobre VIH/SIDA: Un servicio telefónico gratuito y confidencial que ofrece información y apoyo emocional. Número de teléfono: 900 111 000.\n\nRecuerda que es importante buscar información fiable y actualizada sobre el vih, y no dudes en contactar con organizaciones especializadas para recibir apoyo y orientación.\n\nSi tienes alguna otra pregunta o necesitas más información específica, no dudes en preguntar. Estoy aquí para ayudarte en todo lo relacionado con el vih.\n\nReferencias:\n- FELGTBI+. (2019). Guía sobre VIH/SIDA. https://www.felgtbi.org/publicaciones/guia-vih-sida-2019/\n- Apoyo Positivo. (s.f.). Página oficial. https://apoyopositivo.org/\n- Ministerio de Sanidad, Servicios Sociales e Igualdad. (s.f.). Línea de Ayuda sobre VIH/SIDA. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/lineaAyuda.htm	\N	\N	2024-12-10 13:32:40.803293	llm_mvp
