122	80.102.39.52	sistema	¡Hola! Estoy aquí para ayudarte con cualquier consulta relacionada con el vih. Es importante aclarar que mi especialización se centra únicamente en este tema, por lo que no podré asistirte en otros asuntos.\n\nEntiendo que has sido diagnosticado con vih y me gustaría ofrecerte apoyo y recursos para afrontar esta situación. En primer lugar, es fundamental que recibas la atención médica adecuada y que sigas el tratamiento prescrito. Si aún no has iniciado el tratamiento, te recomiendo que busques asistencia médica lo antes posible.\n\nEn cuanto a la divulgación de tu estado serológico, es una decisión personal y depende de tus circunstancias y preferencias. Informar a tus parejas sexuales es crucial para su salud y para prevenir la transmisión del virus. También puedes considerar compartir esta información con personas de confianza, familiares o amigos cercanos que puedan brindarte apoyo emocional.\n\nRecuerda que la Federación Estatal de Lesbianas, Gais, Trans y Bisexuales (FELGTB) ofrece recursos y apoyo a la comunidad LGTBI+. En su página web, puedes encontrar información valiosa sobre el vih, incluyendo guías, materiales educativos y respuestas a preguntas frecuentes: https://felgtbi.org/vih-sida/\n\nAdemás, FELGTB cuenta con un servicio de atención personalizada a través de su línea de información y apoyo:\n\n- Teléfono: 913 604 605\n- Correo electrónico: vih@felgtbi.org\n\nEn estos recursos, encontrarás un espacio seguro y confidencial para resolver dudas, recibir asesoramiento y apoyo emocional relacionado con el vih.\n\n¡Espero haberte sido de ayuda!\n\nReferencias:\n- FELGTB. (s.f.). VIH/SIDA. https://felgtbi.org/vih-sida/	\N	\N	2024-12-10 13:33:08.664735	llm_mvp
