rencias:\n- FELGTBI+. (s.f.). Guía sobre el VIH. https://www.felgtbi.org/wp-content/uploads/2020/09/GuiaVIH.pdf\n- Ministerio de Sanidad, Consumo y Bienestar Social. (s.f.). VIH/sida. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm	\N	\N	2024-12-10 13:33:44.847659	llm_mvp
