pecíficos, no dudes en preguntar. ¡Cuídate mucho!\n\n**Referencias:**\n- FELGTBI+. (n.d.). VIH. https://www.felgtbi.org/vih/\n- Ministerio de Sanidad, Servicios Sociales e Igualdad. (2020). Guía de Prevención y Control del VIH y otras Infecciones de Transmisión Sexual. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/alertasActual/doc/Guia_Prevencion_Control_VIH_ITS_2020.pdf	\N	\N	2024-12-10 13:34:51.679546	llm_mvp
