290	80.102.39.52	sistema	¡Hola! Es genial que estés buscando información y recursos relacionados con el vih. Aquí te proporciono algunos datos y recursos que pueden ser útiles para ti:\n\n**Información sobre el vih:**\n- El vih (virus de la inmunodeficiencia humana) es un virus que afecta al sistema inmunitario y, si no se trata, puede causar el síndrome de inmunodeficiencia adquirida (sida).\n- La transmisión del vih ocurre principalmente a través de relaciones sexuales sin protección, el intercambio de agujas o jeringas contaminadas y la transmisión de madre a hijo durante el embarazo, el parto o la lactancia.\n- Es importante recordar que el vih no se transmite a través de besos, abrazos, compartir utensilios o estar cerca de una persona con vih en espacios públicos.\n\n**Recursos de información:**\n- La Federación Estatal de Lesbianas, Gais, Trans y Bisexuales (FELGTB) ofrece una guía completa sobre el vih y el sida, que puedes encontrar en su página web: [Guía FELGTB sobre VIH/SIDA](https://www.felgtbi.org/vih-sida/). Aquí encontrarás información detallada sobre la prevención, la prueba del vih, el tratamiento y los derechos de las personas con vih.\n- También puedes visitar la página web del Ministerio de Sanidad de España, donde encontrarás información actualizada sobre el vih y los recursos disponibles en tu comunidad autónoma: [Información sobre VIH/SIDA - Ministerio de Sanidad](https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm)\n\n**Recursos de divulgación:**\n- Si deseas compartir información sobre el vih con tu comunidad o amigos, FELGTB tiene materiales educativos y campañas de sensibilización que puedes utilizar. Visita su sección de "Campañas" en su página web para acceder a estos recursos: [Campañas FELGTB](https://www.felgtbi.org/campanas/)\n- También puedes contactar con asociaciones locales en Madrid que trabajan en la prevención y apoyo a personas con vih, como [Apoyo Positivo](https://apoyopositivo.org/) o [Madrid Positivo](https://www.madridpositivo.org/), para obtener materiales informativos y participar en iniciativas de concienciación.\n\n**Apoyo emocional:**\n- Es importante cuidar tu bienestar emocional. Si necesitas apoyo o hablar con alguien sobre tu condición, puedes contactar con asociaciones como Apoyo Positivo, que ofrecen servicios de apoyo psicológico y grupos de apoyo mutuo.\n- Recuerda que es normal sentir ansiedad o preocupación después de un diagnóstico, pero hay recursos disponibles para ayudarte a manejar tus emociones y mantener una buena calidad de vida.\n\nEspero que esta información te sea de utilidad. Recuerda que la educación y la divulgación son herramientas poderosas en la lucha contra el estigma y la discriminación asociados al vih. ¡Cuídate mucho y no dudes en buscar apoyo cuando lo necesites!\n\n**Referencias:**\n- FELGTB. (s.f.). VIH/SIDA. Recuperado de https://www.felgtbi.org/vih-sida/\n- Ministerio de Sanidad, Consumo y Bienestar Social. (s.f.). VIH/SIDA. Recuperado de https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm	\N	\N	2024-12-10 16:21:00.364094	llm_mvp
