uerda que la información y el apoyo son herramientas poderosas en la lucha contra el vih. ¡No dudes en buscar los recursos que necesites y cuidar de tu salud!\n\n**Referencias:**\n- FELGTB. (s.f.). VIH/SIDA. https://www.felgtbi.org/vih-sida/\n- Ministerio de Sanidad, Consumo y Bienestar Social. (s.f.). VIH/sida. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm	\N	\N	2024-12-10 13:38:09.654331	llm_mvp
