ción psicológica y grupos de apoyo para personas con vih: https://www.felgtbi.org/servicios-de-atencion-psicologica/\n- También puedes contactar con asociaciones locales en Madrid que brindan apoyo a personas con vih, como Madrid Positivo (https://www.madridpositivo.org/).\n\nRecuerda, la información y el apoyo son herramientas poderosas en la gestión del vih. ¡Cuídate y no dudes en buscar la ayuda que necesites!\n\n**Referencias:**\n- FELGTB. (n.d.). VIH/SIDA. https://www.felgtbi.org/vih-sida/\n- Ministerio de Sanidad, Consumo y Bienestar Social. (n.d.). VIH/sida. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm	\N	\N	2024-12-10 13:39:47.075226	llm_mvp
