amiento médico.\n\nRecuerda que la información y el conocimiento son herramientas poderosas en la lucha contra el vih. ¡No dudes en buscar apoyo y recursos cuando los necesites!\n\nReferencias:\n- FELGTB. (s.f.). VIH/SIDA. https://www.felgtbi.org/vih-sida/\n- Ministerio de Sanidad, Consumo y Bienestar Social. (s.f.). VIH/SIDA. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm	\N	\N	2024-12-10 13:42:40.260876	llm_mvp
