296	sesion_1733844068082	sistema	El descubrimiento del virus de la inmunodeficiencia humana (vih) fue un proceso complejo que involucró a varios científicos e investigadores. En 1983, un equipo de investigadores franceses dirigido por Luc Montagnier aisló un virus de un paciente con síntomas de sida y lo denominó LAV (Lymphadenopathy-Associated Virus). Al mismo tiempo, un equipo estadounidense liderado por Robert Gallo identificó un virus similar en pacientes con sida y lo llamó HTLV-III. Posteriormente, se determinó que ambos virus eran el mismo, y se le atribuyó el descubrimiento a ambos equipos. Sin embargo, en 2008, el Premio Nobel de Medicina fue otorgado a Montagnier y Françoise Barré-Sinoussi por su contribución al descubrimiento del vih.			2024-12-10 16:22:31.854412	decisor
