220	80.102.39.52	sistema	¡Hola! Es genial que estés buscando información y recursos relacionados con el vih. Estoy aquí para ayudarte y proporcionarte todo el apoyo que necesites.\n\nDado que has compartido que no tienes vih y que nunca has sido diagnosticado con esta condición, me gustaría ofrecerte algunos recursos generales de prevención y concienciación:\n\n- **Prevención:** El uso correcto y consistente del preservativo es una de las formas más efectivas para prevenir la transmisión del vih y otras infecciones de transmisión sexual (ITS). Asegúrate de utilizar preservativos de buena calidad y de la manera adecuada.\n\n- **Pruebas de detección:** Es importante realizarse pruebas de vih regularmente, especialmente si has tenido relaciones sexuales sin protección o si tienes múltiples parejas sexuales. En España, puedes acceder a pruebas gratuitas y confidenciales en centros de salud, clínicas especializadas o a través de organizaciones como la Federación Estatal de Lesbianas, Gais, Trans y Bisexuales (FELGTB).\n\n- **Información y Concienciación:** La FELGTB ofrece una gran variedad de recursos educativos y de concienciación sobre el vih y la salud sexual en general. Puedes visitar su sitio web (https://www.felgtbi.org/) para acceder a guías, folletos y artículos informativos.\n\nAdemás, es admirable que hayas informado a otras personas sobre tu condición. La comunicación abierta y honesta es fundamental para combatir el estigma y la discriminación asociados al vih.\n\nSi tienes alguna pregunta específica o necesitas más información sobre algún tema relacionado con el vih, no dudes en preguntarme. Estoy aquí para brindarte apoyo y recursos adaptados a tus necesidades.\n\nRecursos:\n- FELGTB. (s.f.). VIH/SIDA. https://www.felgtbi.org/temas/vih-sida/\n- FELGTB. (s.f.). Salud Sexual. https://www.felgtbi.org/temas/salud-sexual/\n- Ministerio de Sanidad, Consumo y Bienestar Social. (2022). Guía de prevención de infecciones de transmisión sexual. https://www.mscbs.gob.