ica, te recomiendo contactar a profesionales de la salud o a organizaciones especializadas en vih en tu área.\n\nReferencias:\n- [FELGTBI+ - Salud y VIH](https://felgtbi.org/salud-y-vih/)\n- [Guía práctica sobre salud sexual y VIH para hombres gais y bisexuales](https://felgtbi.org/wp-content/uploads/2019/07/Guia-practica-sobre-salud-sexual-y-VIH-para-hombres-gais-y-bisexuales.pdf)	\N	\N	2024-12-10 13:49:18.452696	llm_mvp
