pos de apoyo locales en Madrid donde puedas compartir experiencias y recibir apoyo de personas en situaciones similares.\n\nRecuerda que la información y el acceso a recursos son clave en la prevención y el manejo del vih. Es importante mantenerse informado y cuidar de la salud propia y de la comunidad.\n\nReferencias:\n- FELGTBI+: https://felgtbi.org/\n- Ministerio de Sanidad de España: https://www.mscbs.gob.es/	\N	\N	2024-12-10 15:11:32.771042	llm_mvp
