300	sesion_1733844068082	sistema	El descubrimiento del virus de la inmunodeficiencia humana (vih) fue un proceso complejo que involucró a varios científicos e investigadores. En 1983, un equipo de investigadores franceses dirigido por Luc Montagnier aisló un virus que creían que estaba relacionado con el sida. Este virus fue llamado LAV (Lymphadenopathy Associated Virus). Al mismo tiempo, un equipo estadounidense liderado por Robert Gallo identificó un virus similar, al que llamaron HTLV-III. Después de algunas controversias y debates, se determinó que ambos virus eran el mismo, y en 1986, el nombre oficial del virus se estableció como VIH. Así que, aunque no hay un único descubridor, estos científicos jugaron un papel crucial en la identificación y comprensión del vih.			2024-12-10 16:29:08.615412	decisor
