334	92.191.114.33	sistema	¡Hola! Es genial que estés buscando información y recursos relacionados con el vih. Aquí te proporciono algunos datos y recursos que pueden ser útiles para ti:\n\n**Información sobre el vih:**\n- El vih (virus de inmunodeficiencia humana) es un virus que afecta al sistema inmunitario y, si no se trata, puede causar el síndrome de inmunodeficiencia adquirida (sida).\n- La transmisión del vih ocurre principalmente a través de relaciones sexuales sin protección, el intercambio de agujas o jeringas contaminadas y la transmisión de madre a hijo durante el embarazo, el parto o la lactancia.\n- Es importante recordar que el vih no se transmite a través de besos, abrazos, compartir utensilios o estar cerca de una persona con vih en el trabajo o en espacios públicos.\n\n**Recursos de información:**\n- La Federación Estatal de Lesbianas, Gais, Trans y Bisexuales (FELGTB) ofrece una guía completa sobre el vih/sida en su página web. Aquí encontrarás información detallada sobre la prevención, la prueba del vih, el tratamiento y los derechos de las personas con vih: https://felgtbi.org/vih-sida/\n- También puedes visitar la página web del Ministerio de Sanidad de España, donde encontrarás información actualizada sobre el vih/sida, métodos de prevención y recursos disponibles en el sistema sanitario público: https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm\n\n**Recursos de divulgación:**\n- Si deseas contribuir a la divulgación y concienciación sobre el vih en tu comunidad, puedes ponerte en contacto con asociaciones locales o grupos de apoyo en Madrid. La FELGTB tiene una sección de grupos de apoyo en su página web: https://felgtbi.org/grupos-de-apoyo/\n- Además, puedes participar en campañas de concienciación y eventos organizados por la FELGTB u otras organizaciones durante el Día Mundial del Sida, que se celebra el 1 de diciembre de cada año.\n\n**Apoyo emocional:**\n- Es comprensible que vivir con el vih pueda generar preocupaciones y emociones diversas. Si necesitas apoyo emocional o deseas hablar con alguien que entienda tu situación, puedes contactar con líneas de ayuda especializadas:\n    - Línea de Atención y Apoyo al VIH: 900 21 22 21 (gratuita y confidencial, disponible en toda España).\n    - Línea de Apoyo Emocional de la FELGTB: 665 56 05 05 (servicio de WhatsApp, de lunes a viernes de 17:00 a 21:00).\n\nRecuerda que es importante seguir las recomendaciones médicas y mantener un estilo de vida saludable. Si tienes cualquier otra pregunta o necesitas más información específica, no dudes en preguntar. ¡Estoy aquí para ayudarte!\n\n**Referencias:**\n- FELGTB. (s.f.). VIH/SIDA. https://felgtbi.org/vih-sida/\n- Ministerio de Sanidad, Consumo y Bienestar Social. (s.f.). VIH/SIDA. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm	\N	\N	2024-12-10 20:36:58.400265	llm_mvp
