cialidad son fundamentales, así que respeta el espacio y las decisiones de tu conocido. Si necesitas más información o recursos, la FELGTB es una excelente fuente de apoyo y cuenta con una red de asociaciones en toda España.\n\n¡Espero que esta información sea de ayuda!\n\n**Referencias:**\n- FELGTB. (s.f.). Salud. Recuperado de [https://felgtbi.org/salud/](https://felgtbi.org/salud/)\n- FELGTB. (s.f.). Prueba rápida de vih. Recuperado de [https://felgtbi.org/salud/vih-sida/prueba-rapida-vih/](https://felgtbi.org/salud/vih-sida/prueba-rapida-vih/)	\N	\N	2024-12-10 21:50:15.748199	llm_mvp
