374	80.102.39.52	sistema	¡Hola! Es genial que estés buscando información y recursos relacionados con el vih. Aquí hay algunos datos y recursos que pueden ser útiles para ti:\n\n**Información sobre el vih:**\n- El vih (virus de inmunodeficiencia humana) es un virus que afecta al sistema inmunitario y, si no se trata, puede causar el síndrome de inmunodeficiencia adquirida (sida).\n- La transmisión del vih ocurre principalmente a través de relaciones sexuales sin protección, compartir agujas o jeringas contaminadas, y de madre a hijo durante el embarazo, parto o lactancia.\n\n**Recursos de información:**\n- La Federación Estatal de Lesbianas, Gais, Trans y Bisexuales (FELGTB) ofrece una guía completa sobre el vih/sida en su página web. Puedes encontrar información detallada sobre la prevención, pruebas, tratamiento y derechos relacionados con el vih: https://felgtbi.org/vih-sida/\n- El Ministerio de Sanidad de España también proporciona información actualizada sobre el vih/sida, incluyendo estadísticas, recomendaciones y recursos: https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm\n\n**Recursos de divulgación:**\n- Si deseas compartir información sobre el vih con tu comunidad o amigos, FELGTB tiene materiales educativos y campañas de concienciación que puedes utilizar. Visita su sección de "Prevención" para obtener recursos: https://felgtbi.org/prevencion/\n- También puedes contactar a organizaciones locales en Madrid que trabajan en la prevención y apoyo a personas con vih, como Madrid Positivo o Apoyo Positivo, para obtener materiales informativos y asesoramiento.\n\n**Apoyo emocional:**\n- Es importante cuidar tu bienestar emocional. Si necesitas apoyo o deseas hablar con alguien sobre tu condición, existen líneas de ayuda y grupos de apoyo especializados.\n- Apoyo Positivo ofrece servicios de apoyo emocional y acompañamiento para personas con vih: https://apoyopositivo.org/\n- También puedes buscar grupos de apoyo locales en Madrid donde puedas compartir experiencias y conectar con otras personas en situaciones similares.\n\nRecuerda que la información y el acceso a recursos son clave en la prevención y el manejo del vih. Si tienes más preguntas o necesitas asistencia adicional, no dudes en consultar a profesionales de la salud o a organizaciones especializadas en vih.\n\nReferencias:\n- FELGTB. (s.f.). VIH/SIDA. https://felgtbi.org/vih-sida/\n- Ministerio de Sanidad, Consumo y Bienestar Social. (s.f.). VIH/SIDA. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/home.htm	\N	\N	2024-12-11 12:08:43.594734	llm_mvp
