516	80.102.39.52	sistema	¡Hola! Estoy aquí para ayudarte y proporcionarte información sobre el vih.\n\nEl vih (virus de la inmunodeficiencia humana) es un virus que afecta al sistema inmunitario y puede causar una condición llamada sida (síndrome de inmunodeficiencia adquirida) si no se trata adecuadamente. Es importante conocer los hechos y derribar los mitos que rodean al vih, ya que esto ayuda a crear conciencia y a reducir el estigma asociado.\n\nSi deseas obtener información sobre el vih, aquí te proporciono algunos recursos:\n\n- **Información general sobre el vih:**\n   - El vih se transmite principalmente a través de relaciones sexuales sin protección, uso compartido de jeringuillas o agujas contaminadas, y de madre a hijo durante el embarazo, parto o lactancia.\n   - Las personas con vih pueden vivir vidas largas y saludables con el tratamiento adecuado, que consiste en una combinación de medicamentos llamados terapia antirretroviral (TAR).\n   - Es importante realizarse pruebas de detección del vih regularmente, especialmente si has tenido conductas de riesgo. Las pruebas son confidenciales y pueden hacerse en centros de salud, clínicas especializadas o asociaciones LGTBI+.\n\n- **Recursos de FELGTBI+:**\n   - FELGTBI+ (Federación Estatal de Lesbianas, Gais, Trans, Bisexuales, Intersexuales y más) ofrece información y apoyo a personas LGTBI+ con vih. Puedes encontrar recursos en su página web: [Información sobre VIH](https://www.felgtbi.org/salud/vih/).\n   - También puedes contactar con sus asociaciones miembros para obtener apoyo local y conocer los servicios disponibles en tu comunidad.\n\n- **Recursos de apoyo emocional:**\n   - Vivir con vih puede generar preocupaciones y emociones diversas. Si necesitas apoyo emocional, existen líneas de ayuda y grupos de apoyo donde puedes compartir tus experiencias con otras personas en situaciones similares.\n   - La Federación Española de Lesbianas, Gais, Trans y Bisexuales (FELGTB) ofrece una línea de apoyo emocional llamada "Apoyo Positivo": [Apoyo Positivo](https://www.felgtbi.org/salud/apoyo-positivo/).\n\nRecuerda que la información y el apoyo son clave para mantener una buena salud y bienestar. Si tienes más preguntas o necesitas recursos adicionales, no dudes en pedírmelos. Estoy aquí para ayudarte en todo lo relacionado con el vih.\n\n**Referencias:**\n- FELGTBI+. (s.f.). Información sobre VIH. https://www.felgtbi.org/salud/vih/\n- FELGTBI+. (s.f.). Apoyo Positivo. https://www.felgtbi.org/salud/apoyo-positivo/	\N	\N	2024-12-11 17:25:24.054114	llm_mvp
