518	80.102.39.52	sistema	¡Hola! Gracias por contactar conmigo. Entiendo que estás pasando por un momento difícil y es completamente normal sentir miedo después de recibir un diagnóstico de vih. Estoy aquí para brindarte información y apoyo.\n\nEn primer lugar, quiero recordarte que el vih ya no es una sentencia de muerte. Con los avances médicos y los tratamientos disponibles, las personas con vih pueden llevar una vida larga y saludable. Es importante que sigas las indicaciones de tu médico y mantengas una adherencia al tratamiento.\n\nSi te diagnosticaron hace entre 3 y 12 meses, es probable que ya hayas comenzado a recibir atención médica y tratamiento. ¿Has notado alguna mejora en tu estado de salud desde que empezaste el tratamiento? Es importante que te sientas cómoda y confíes en tu equipo médico, así que no dudes en expresarles cualquier preocupación o duda que tengas.\n\nEn cuanto a informar a otras personas sobre tu condición, es una decisión personal y depende de cómo te sientas al respecto. No estás obligada a compartir esta información con nadie si no te sientes preparada o cómoda. Sin embargo, si deseas buscar apoyo emocional o compartir tu experiencia, existen grupos de apoyo y organizaciones que pueden ayudarte.\n\nLa Federación Estatal de Lesbianas, Gais, Trans y Bisexuales (FELGTB) ofrece recursos y apoyo a personas LGTBI+ con vih. Puedes encontrar información en su página web [FELGTB](https://www.felgtb.org/vih-sida/) o contactar con ellos para obtener orientación y apoyo emocional.\n\nRecuerda, no estás sola en esto. Hay muchas personas y organizaciones dispuestas a ayudarte y apoyarte en tu viaje. ¡Cuídate mucho y no dudes en buscar el apoyo que necesites!\n\nReferencias:\n- FELGTB. (s.f.). VIH/SIDA. https://www.felgtb.org/vih-sida/\n- Ministerio de Sanidad, Consumo y Bienestar Social. (2022). Guía de Prevención y Control del VIH y otras ITS en HSH y personas Trans. https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/sida/docs/Guia_Prevencion_VIH_ITS_HSH_Trans_2022.pdf	\N	\N	2024-12-11 17:36:09.014811	llm_mvp
