794	80.102.39.52	sistema	¡Hola! Soy un chatbot especializado en brindar información y apoyo en temas relacionados con el vih. Entiendo que estás buscando recursos y orientación para un paciente que no vive con el vih.\n\nEs importante resaltar que, aunque no tenga el vih, es fundamental promover la prevención y el conocimiento sobre esta infección. Aquí te proporciono algunos recursos que pueden ser útiles para tu paciente y para tu propio aprendizaje:\n\n- **Información general sobre el vih**: La Federación Estatal de Lesbianas, Gais, Trans, Bisexuales, Intersexuales y más (FELGTBI+) ofrece una guía completa sobre el vih, incluyendo información sobre vías de transmisión, pruebas, tratamiento y derechos de las personas que viven con el vih: [Guía sobre el VIH](https://www.felgtbi.org/vih-sida/).\n\n- **Prevención y Pruebas**: Es crucial promover la realización de pruebas de detección del vih regularmente, especialmente en poblaciones de riesgo. Puedes encontrar información sobre centros de pruebas y prevención en la web de [SEISIDA](https://www.seisida.org/centros-de-prueba-rapida-vih/).\n\n- **Formación**: Dado que mencionas que no has tratado previamente con pacientes con vih, te recomiendo explorar recursos educativos. La FELGTBI+ ofrece cursos y talleres sobre vih y salud sexual, que pueden ser de gran valor para tu práctica profesional: [Formación FELGTBI+](https://www.felgtbi.org/formacion/).\n\nRecuerda que la confidencialidad y el apoyo emocional son aspectos clave en la atención a personas con vih o en riesgo. Si necesitas más recursos o información específica, no dudes en preguntar. Estoy aquí para ayudarte en todo lo relacionado con el vih.\n\nReferencias:\n- FELGTBI+. (s.f.). VIH/SIDA. https://www.felgtbi.org/vih-sida/\n- SEISIDA. (s.f.). Centros de Prueba Rápida VIH. https://www.seisida.org/centros-de-prueba-rapida-vih/	\N	\N	2024-12-12 08:56:42.995219	llm_mvp
