875	sesion_1733844068082	sistema	¡Hola! Te puedo ofrecer información sobre el tema que me comentas. Aquí tienes algunas fuentes de divulgación sobre la erradicación del vih:\n\n- La Federación Estatal de Lesbianas, Gais, Trans, Bisexuales e Intersexuales (FELGTBI+) cuenta con puntos de información en todas las comunidades autónomas, donde se puede acceder a recursos y asesoramiento sobre diferentes cuestiones relacionadas con el vih. Puedes encontrar el punto de información más cercano a ti a través de su página web: https://www.felgtb.org/que-hacemos/salud/puntos-de-informacion-sobre-vih-sida\n\n- El Ministerio de Sanidad también dispone de una sección dedicada al vih en su portal, con información actualizada sobre el virus, su prevención, diagnóstico y tratamiento. Además, promueve campañas de concienciación y prevención. Puedes consultar su web aquí: https://www.mscbs.gob.es/profesionales/saludPublica/ccayes/vihsida/home.htm\n\n- La organización Médicos del Mundo tiene un apartado en su página web dedicado específicamente a la información sobre el vih, con recursos y guías descargables. También realizan una labor de concienciación y educación sobre el virus. Puedes acceder a su contenido en: https://www.medicosdelmundo.org/que-hacemos/proyectos/vih-sida/\n\n- El portal del Instituto Nacional de Enfermedades Infecciosas es otra fuente fiable de información. Ofrecen datos actualizados sobre el vih, así como guías de práctica clínica y documentos de consenso sobre el manejo de la infección. Lo encontrarás en: https://www.isciii.es/Default.aspx?tabid=578&idioma=es&idOrganismo=inhiv\n\nEs importante que solo se obtenga información de fuentes fiables y contrastadas, para evitar bulos y desinformación sobre el vih.\n¿Hay algo más en lo que te gustaría que te ayudara?	sociosanitario	divulgacion	2024-12-12 11:02:13.390147	resolutor
