957	sesion_1733938452160	sistema	¡Hola, usuario! Te puedo ofrecer información sobre el descubrimiento del vih.\n\nEl virus de inmunodeficiencia humana (vih) fue descubierto en 1983 por el científico francés Luc Montagnier y su equipo del Instituto Pasteur de París. Fue quien aisló el virus y demostró su presencia en personas con síndrome de inmunodeficiencia adquirida (sida). Por este descubrimiento, Montagnier fue galardonado con el Premio Nobel de Medicina en 2008.\n\nSin embargo, es importante destacar que antes de este descubrimiento, ya había muchas investigaciones en curso sobre las causas del sida. Por ejemplo, en 1982, el doctor Robert Gallo, del Instituto Nacional del Cáncer de Estados Unidos, afirmó haber aislado un virus similar en pacientes con sida. También se sabe que algunos investigadores estadounidenses habían descubierto anticuerpos del vih en la sangre de pacientes con sida años antes.\n\nLa controversia sobre el descubrimiento se debió en parte a las diferentes denominaciones del virus: el equipo francés lo llamó LAV (Lymphadenopathy Associated Virus), mientras que el estadounidense lo denominó HTLV-III (Human T-cell Lymphotropic Virus Type III). Más tarde, se acordó que el virus sería conocido como vih (virus de inmunodeficiencia humana).\n\nEn España, la Federación Estatal de Lesbianas, Gais, Trans, Bisexuales e Intersexuales (FELGTBI+) es una excelente fuente de información sobre el vih y el sida, y cuenta con recursos y servicios para apoyar a las personas afectadas y promover la sensibilización y la educación sobre el tema. Puedes consultar su página web: https://www.felgt.org/\n\n¿Hay algo más en lo que te gustaría que te ayudara?			2024-12-12 13:59:19.677774	resolutor
