982	prueba_raul_limpiador	usuario	¿Quien descubrio el vih?	cerrada	divulgacion	2024-12-12 15:07:59.878983	decisor
983	prueba_raul_limpiador	sistema	El descubrimiento del virus de la inmunodeficiencia humana (vih) fue un proceso complejo que involucró a varios investigadores y científicos. En 1983, un equipo de investigadores franceses dirigido por Luc Montagnier identificó un nuevo retrovirus en pacientes con síntomas de inmunodeficiencia, y lo denominaron LAV (Lymphadenopathy Associated Virus). Al mismo tiempo, un grupo de investigadores estadounidenses liderados por Robert Gallo también aisló un retrovirus similar en personas con la misma condición, al que llamaron HTLV-III. Posteriormente, se determinó que ambos virus eran el mismo, y se estableció el nombre de VIH (Virus de la Inmunodeficiencia Humana). Este descubrimiento fue crucial para comprender la enfermedad y desarrollar tratamientos efectivos.			2024-12-12 15:08:00.226986	decisor
