988	prueba_raul_limpiador	usuario	Como me puedo contagiar de vih?	cerrada	divulgacion	2024-12-12 15:12:47.358886	decisor
989	prueba_raul_limpiador	sistema	El virus de la inmunodeficiencia humana (vih) se transmite a través de fluidos corporales infectados, como la sangre, el semen, el líquido preseminal, las secreciones vaginales y la leche materna. Las vías de transmisión más comunes son las relaciones sexuales sin protección, el uso compartido de jeringuillas o agujas infectadas y la transmisión de madre a hijo durante el embarazo, el parto o la lactancia. Es importante recordar que el vih no se transmite a través del contacto casual, como abrazar, besar, compartir utensilios o estar cerca de una persona con vih.			2024-12-12 15:12:47.627781	decisor
