1113	prueba_raul_limpiador	sistema	¡Hola, usuario! Por supuesto que te puedo ayudar con tus dudas. Tengo entendido que vives en Madrid y que necesitas recursos de apoyo relacionados con el vih.\n\nUna de las organizaciones más importantes en España dedicada a la atención y apoyo de personas con vih es la Federación Estatal de Lesbianas, Gais, Trans, Bisexuales e Intersexuales (FELGTBI+). Esta organización ofrece información, asesoramiento y apoyo psicológico a través de su línea telefónica y online, que puedes encontrar en su página web: https://www.felgt.org/\n\nTambién en Madrid, la asociación Apoyo Positivo ofrece servicios de atención psicosocial, jurídica y de ocio para personas afectadas por el vih. Puedes encontrar más información en su página: https://apoypositivo.org/\n\nAdemás, el sistema público de salud en España ofrece atención y tratamiento gratuitos para personas con vih. Te recomiendo que consultes con tu centro de salud más cercano o con un profesional de la medicina al que puedas acceder para recibir información y apoyo especializados.\n\nEs importante que tengas acceso a información y recursos confiables y actualizados, ya que el diagnóstico y el acceso temprano al tratamiento mejoran significativamente la calidad de vida de las personas con vih.\n\n¿Hay algo más en lo que te gustaría que te ayudara? ¿Tienes alguna otra pregunta relacionada con el vih?			2024-12-12 18:20:30.187432	resolutor
