1138	ensayo_presentacion_1	sistema	¡Hola, usuario! Te puedo ofrecer información sobre cómo y dónde realizarte una prueba del vih.\n\nEn primer lugar, te comento que en España existen centros especializados en el diagnóstico y tratamiento del vih, llamados Unidades de Conductas Adictivas (UCAs). En cada comunidad autónoma hay un centro de referencia para las UCAs, que suelen estar ubicadas en los hospitales.\n\nEn tu caso, al ser de Zaragoza (Aragón), la prueba la puedes realizar en el Hospital Clínico Universitario Lozano Blesa, que es el centro de referencia en Aragón. Allí podrás acceder a una prueba rápida y confidencial. Además, si necesitas información o apoyo psicológico, cuenta con un equipo multidisciplinar que te podrá orientar.\n\nOtra opción que tienes son las asociaciones comunitarias que trabajan en el ámbito del vih. La Federación Estatal de Lesbianas, Gais, Trans y Bisexuales (FELGTB), por ejemplo, tiene un buscador en su página web donde puedes localizar recursos cercanos a ti. En Zaragoza, la asociación Stop Sida Aragón realiza pruebas rápidas y gratuitas, y también ofrecen información y apoyo. Puedes consultar su ubicación y horarios en su página web: https://stopsida.org/aragon/.\n\nRecuerda que también puedes acudir a tu centro de salud habitual y solicitar una prueba del vih. Si lo prefieres, también hay disponibles test rápidos en farmacias, aunque debes tener en cuenta que su precio puede variar.\n\n¿Hay algo más en lo que te gustaría que te ayudara? ¡Estoy aquí para apoyarte!			2024-12-12 18:30:33.576688	resolutor
