1222	ensayo_presentacion_2	sistema	¡Hola, usuario! Te puedo ofrecer información sobre cómo y dónde realizarte la prueba del vih.\n\nSi vives en Zaragoza (Aragón), puedes acudir a los centros de salud sexual y reproductiva de la ciudad. Allí se realizan pruebas rápidas y gratuitas, y los resultados los suelen dar en unos 30 minutos. También puedes acudir a tu centro de salud habitual y pedir una cita con enfermería para realizarte la prueba.\n\nSi prefieres ir a un espacio LGTBI+ friendly, en Zaragoza tienes el colectivo Apoyo Positivo, que ofrece información, asesoramiento y apoyo a personas afectadas por el vih y sus allegados. Puedes ponerte en contacto con ellos a través de su página web: https://apoypositivo.org/\n\nRecuerda que también puedes encontrar información fiable en la página de FELGTBI+, donde tienen un apartado dedicado a recursos sobre el vih: https://www.felgtb.org/recursos/vih-sida\n\n¿Hay algo más en lo que te gustaría que te ayudara?			2024-12-12 19:25:29.644013	resolutor
