1286	ensayo_presentacion_2	sistema	¡Hola, usuario! Me alegra que te hayas dirigido a mí con tus dudas sobre el vih. Te puedo informar que en Madrid existen varios lugares donde puedes acceder a la prueba del vih, también conocida como la prueba del SIDA.\n\nLa organización FELGTBI+ recomienda los siguientes centros donde se puede realizar la prueba de manera confidencial y gratuita:\n\n1. Centro Sanitario Sandoval, ubicado en la Calle Sandoval 3, 28018 Madrid.\n\n2. Centro de Salud Sexual y Reproductiva de la Comunidad de Madrid (CRESI), en la Calle Conde de Romanones, 7, 28012 Madrid. Ofrecen atención especializada en salud sexual.\n\n3. Unidades del Programa de Detección Precoz del vih en Madrid. Puedes encontrar la unidad más cercana a ti en este enlace: https://www.madrid.org/cs/Satellite?c=Page&id_p=10369&id_t=1197&language=es&site=wwwmadridorg.\n\nEs importante que tengas en cuenta que, en caso de que desees realizar la prueba de manera anónima, puedes acudir a cualquier hospital público de la red sanitaria de la Comunidad de Madrid. Además, si deseas información sobre los recursos y servicios de la comunidad LGTBI+ en Madrid, puedes consultar la página web de FELGTBI+ Madrid: https://felgt.org/territorios/madrid/.\n\n¿Hay algo más en lo que te gustaría que te ayudara? Recuerda que es importante informarse bien sobre el tema.			2024-12-12 20:49:47.309471	resolutor
